import React from 'react';
import { Container, Nav, Navbar } from 'react-bootstrap';

const Topbar = () => {
  return ( 
    <Navbar bg="dark" variant="dark" expand="lg">
      <Nav.Link>Home</Nav.Link>
    </Navbar>
   );
}


export default function Cover() {
  return (
      <>
      <Topbar />
        <Container>
            <h1>Projects</h1>

        </Container>
        </>
  )
}
